import React from 'react';
import images from "../Utilities/ImageDirectories/TeamImageDirectory/God'sVineyardFC.json"

function App() {
  const images = [
    { id: 1, url: '(link unavailable)', alt: 'Image 1' },
    { id: 2, url: '(link unavailable)', alt: 'Image 2' },
    { id: 3, url: '(link unavailable)', alt: 'Image 3' },
    // Add more images here...
  ];

  return (
    <div className="flex flex-wrap justify-center">
      {images.map((image, index) => (
        <img
          key={index}
          src={image.url}
          alt={image.alt}
          className="w-64 h-64 object-cover m-4"
        />
      ))}
    </div>
  );
}

export default App;
